import React, {Component} from "react";
import "./style.css";

class Product extends Component{
    render() {
        return(<>
                <div className="Product">
                    <img src={this.props.image}/>
                    <p>{this.props.name}</p>
                    <p>{this.props.price}</p>
                </div>
            </>)
    }
}

export default Product;
